import React, {useState, useEffect} from "react";

import {
    Checkbox,
    Grid,
    TextField,
    FormControlLabel,
    Paper,
    Button
    ,Avatar
  } from '@material-ui/core';


const MyProfile = () => {


    const [email, setEmail] = useState("");
    const [password, setPassword] = useState([]);
    const [confirmPassowrd, setconfirmPassword] = useState([]);





    const onChangeEmail = (e) =>{
      const email = e.target.value;
      setEmail(email);
    }

    const onChangePassword = (e) => {
      const password = e.target.value;
      setPassword(password);

    }

    const onChangePasswordC = (e) => {
        const confirmPassowrd = e.target.value;
        setconfirmPassword(confirmPassowrd);
    }

    const handleSubmit = (e) => {
      e.preventDefault();
      console.log('username:', email, 'password: ', password );
    }


    return(

        <>
          <div style={{ padding: 150}}>


      <Paper>



        <Grid
          container
          spacing={3}
          direction={'column'}
          justify={'center'}
          alignItems={'center'}
        >
            <Avatar alt="Remy Sharp" src="/static/images/avatar/1.jpg" />
            <div className="text">My Profile</div>

          <form onSubmit={handleSubmit} >
          <Grid item xs={12}>
            <TextField  
            label="Username"
             type="text"
              className="form-control"
              name="email"
              value={email}
              onChange={onChangeEmail}
              validations={''}
              ></TextField>
          </Grid>
          <Grid item xs={12}>
            <TextField label="Password" type="password" className="form-control" name="password" value={password} onChange={onChangePassword} validations={''}></TextField>
          </Grid>
          <Grid item xs={12}>
          </Grid>
          <Grid item xs={12}>
            <TextField label="confirmpassword" type="password" className="form-control" name="password" value={confirmPassowrd} onChange={onChangePasswordC} validations={''}></TextField>
          </Grid>
          <Grid item xs={12}>
            <Button type="submit" fullWidth> Update Profile </Button>
          </Grid>
          </form>
        </Grid>
      </Paper>
    </div>
    </>
    )

}

export default MyProfile;
